        return(
            <div className="mycontainer">
                <div className="container mt-5">
                    <div className="col">
                        <div className="filtercss row-md-4 text-center">
                              col - 4
                        </div>
                        <div className="row-md-8">
                             <div><FontAwesomeIcon color="white" size="3x" icon={faCouch}></FontAwesomeIcon></div>
                        </div>
                    </div>
                </div>
                
            </div>
        )
    }
}

export default seatReservation;
